import React from 'react'
import Nav from '../components/Nav'


export default function Home() {
  return (
    <div className="home">
      Lorem ipsum dolor sit amet consectetur adipisicing elit. Quae vel libero id iste. Vitae impedit eius delectus minima nam qui soluta ipsum veniam quis consequatur tenetur accusamus, necessitatibus reiciendis repellendus.
    </div>
  )
}
